import React from "react";
import Header from "../Header/header";

function ShowPost() {
    return(
        <>
            <Header></Header>
            <div className="back">
                <div className="border">
                    <div className="pageTitle">레몬 하나에는 </div>
                </div>
            </div>

        </>
    )
}
export default ShowPost;
